  return (
    <>
    <Navbar/>
   <div className='Card-heading'>
    <div className='Sub-head'>
<h2>Collections Of Bridal Products In Rare Fairy</h2>
<div className='Sub-head1'>
  <p>Rare fairy is a clothes store in Kovaipudur, Coimbatore, that offers a wide range of designs.
